 function TaskList({tasks}) {   // usamos {tasks} para importarlo en vez de usar props y luego tener que usar props.tasks

  if (tasks.length === 0) {
    return <h1>No hay tareas aun</h1>
  }

  return (
    <div>
      {tasks.map((task) => (
        <div key={task.id}>
            <h1>{task.title}</h1>
            <p>{task.description}</p>
        </div>
      ))}
    </div>
  );
}

export default TaskList
